import React from "react";
import Guide from "./guide";
import history from "../../routing/history";
import Animation from "../../animations/animation";
const Landing = () => {
  return (
    <div className="container-fluid">
      <div className="row no-gutters justify-content-center">
        <div className="col-3">
          <div className="row" style={{ height: "600px" }}>
            <div className="col-12 h-33"></div>
            <div className="col-12 h-33">
              <Guide
                name="Dashboard"
                callback={() => {
                  history.push("/dashboard");
                }}
              ></Guide>
            </div>
            <div className="col-12 h-33"></div>
          </div>
        </div>
        <div className="col-3">
          <div className="row" style={{ height: "600px" }}>
            <div className="col-12 h-33">
              <Guide
                name="Connect Bot"
                callback={() => {
                  window.open(
                    "https://discordapp.com/oauth2/authorize?client_id=683749582705786882&scope=bot&permissions=2146958591"
                  );
                }}
              ></Guide>
            </div>
            <div className="col-12 h-18"></div>
            <div className="col-12 h-33">
              <Guide name="Command list" status="To be developed"></Guide>
            </div>
          </div>
        </div>
        <div className="col-3"></div>
        <div className="col-3">
          <Animation></Animation>
        </div>
      </div>
    </div>
  );
};

export default Landing;
